import * as React from "react";
import { Text, TouchableOpacity, StyleSheet, View } from "react-native";
import { NavigationContainer } from "@react-navigation/native";
import Banner from "./layouts/Banner";
import DrawerNavigation from "./layouts/DrawerNavigation";
import MenuHeader from "./layouts/MenuHeader";

function PageHome({ navigation }) {
  return (
    <View>
      <MenuHeader navigation={navigation} titulo="Bem vindo a CentralRH" />
      <Banner />
      <Text>Home</Text>
    </View>
  );
}
function PageVagas({ navigation }) {
  return (
    <View>
      <MenuHeader navigation={navigation} titulo="Confira nossas vagas" />
      <Text>Vagas</Text>
    </View>
  );
}
function PageCurriculo({ navigation }) {
  return (
    <View>
      <MenuHeader navigation={navigation} titulo="Baixe seu Curriculo" />
      <Text>Curriculo</Text>
    </View>
  );
}
function PageQuemsomos({ navigation }) {
  return (
    <View>
      <MenuHeader navigation={navigation} titulo="Quem somos nós" />
      <Text>Sobre nós</Text>
    </View>
  );
}

export default function App() {
  return (
    <NavigationContainer>
      <DrawerNavigation />
    </NavigationContainer>
  );
}
